import React from "react";
import { YOUTUBEURL, PLAYLISTSITEMS, apiKey } from "./apis";
import { useState } from "react";
import Playlist from '../components/movie/Playlist';
import ids from "../channelId/ids";

export const PlaylistItems = async ({createrId}) => {
  const [plistItems, setPlistItems] = useState([]);
  const id=Playlist(createrId)[0];
  const json = await (
    await fetch(
      `${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${
        id
      }&part=snippet`
    )
  ).json();
  setPlistItems(json);
  const videoId=plistItems.items?.snippet.resourceId.videoId;
  return videoId;
};

export default PlaylistItems;
